    let result;
    for (let i = 0; i < arr.length; i++) {
        var cdate = new Date(arr[i].date);
        cdate.setHours(cdate.getHours() + 2);
        var rdate = cdate.toISOString();
        if (rdate.includes(currentDate)) {
            result = arr[i];
            break;
        }
    }
    return result;
}
